Storyline:

     U.S Air Force Sgt. Chuck Brennan always disliked playboy and hotshot, Col. Jim Herlihy. He first met him in Korea where his emergency arrival for repairs caused the death of several of his crewmen. Now, several years later, when Chuck is weighing continued enlistment or retirement, the base's new C.O. is none other than Col. Herlihy. Compounding his dislike is a budding romance with Chuck's daughter, Lois.



